import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the link to the Electronics category
    const electronicsLink = page.getByRole('link', { name: 'Shop electronics' });
    await electronicsLink.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsLink.click();

    // Take a screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_clicked_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_clicked_electronics.png'));

    return {
      success: true,
      action: "Clicked on the 'Shop electronics' link to navigate to the Electronics category.",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to the Electronics category.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
